import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { LoginService } from '../login.service';

@Component({
  selector: 'app-page5',
  templateUrl: './page5.component.html',
  styleUrls: ['./page5.component.css']
})
export class Page5Component implements OnInit {
  buttonStats: any[] = [];

  constructor(private loginService: LoginService, private router: Router) { }

  ngOnInit(): void {
    const userId = '1'; // Örnek kullanıcı ID'si, gerçek ID ile değiştirin

    this.loginService.getButtonStats(userId).subscribe(data => {
      this.buttonStats = data.buttonStats;
      console.log('Button stats:', this.buttonStats); // Verilerin alınıp alınmadığını kontrol edin
    }, error => {
      console.error('Error fetching button stats', error);
    });
  }

  navigateToPage(page: string): void {
    this.router.navigate([`/${page}`]);
  }

  logout(): void {
    // Çıkış yapma işlemleri burada yapılabilir
    console.log('Çıkış yapılıyor...');
  }
}
